      name: "12 Create a Design System for Enum Workspace.",
      status: "Todo",
      dueDate: new Date(2022, 7, 24),
    },
    {
      id: "T-6",
      name: "12 Create a Design System for Enum Workspace.",
      status: "Completed",
      dueDate: new Date(2022, 7, 24),
    },
  ];

  return (
    <div className="app-container">
      <h1>Task Manager</h1>
    <TaskViewer taskList={data}/>
    </div>
  );
}

export default App;
